/// <summary>
///    Gets the last updated journal for the <c>SalesTable</c>.
/// </summary>
void  lastJournals()
{
    container lastJournals = purchTable.RORlastJournals();

    [lastPurchOrder,    lastPurchOrderDate]     = conpeek(lastJournals, PurchTableType::posPurchaseOrder());
    [lastReceiptsList,  lastReceiptsListDate]   = conpeek(lastJournals, PurchTableType::posReceiptsList());
    [lastPackingSlip,   lastPackingSlipDate]    = conpeek(lastJournals, PurchTableType::posPackingSlip());
    [lastInvoiced,      lastInvoicedDate]       = conpeek(lastJournals, PurchTableType::posInvoice());

    [lastPreperation,   lastPreperationDate]    = conpeek(lastJournals, PurchTableType::RORPosPreperation());
    [lastOutbound,      lastOutboundDate]       = conpeek(lastJournals, PurchTableType::RORPosOutbound());

    [lastBuild,         lastBuildDate]          = conpeek(lastJournals, PurchTableType::RORPosBuild());
    [lastEventStart,    lastEventStartDate]     = conpeek(lastJournals, PurchTableType::RORPosEventStart());
    [lastEventEnd,      lastEventEndDate]       = conpeek(lastJournals, PurchTableType::RORPosEventEnd());
    [lastStrike,        lastStrikeDate]         = conpeek(lastJournals, PurchTableType::RORPosStrike());
    [lastInbound,       lastInboundDate]        = conpeek(lastJournals, PurchTableType::RORPosInbound());

    [lastReturned,      lastReturnedDate]       = conpeek(lastJournals, PurchTableType::RORPosReturned());
    [lastInspection,    lastInspectionDate]     = conpeek(lastJournals, PurchTableType::RORPosReturnInspection());
}

